import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Image, Row, Col } from "react-bootstrap";
import './index.css'
import './SUNRISE-BUILDING-PHOTOGRAPHY-809801.jpeg'




function SplashPage() {
  return (
<Container>
<br />
<br />
<br />
<br />
  <Row className="mt-5">
    <Col>
  <Image src='./SUNRISE-BUILDING-PHOTOGRAPHY-809801.jpeg' fluid />
    </Col>
  </Row>
</Container>
  );
}

export default SplashPage;
